<template>
  <div class="mynotes-note">
    <headerdone @backsome="backsummary"></headerdone>
    <div class="note-title">
      <div class="title-title" id="note-title" contenteditable="true" style="outline: none" placeholder="请输入标题">
        {{note.title}}
      </div>
    </div>
    <div class="note-content">
      <div class="content-part">
        <div class="part-text" contenteditable="true">
          <div style="outline: none">{{note.content}}</div>
        </div>
      </div>
      <div class="content-img" v-for="(i,index) in note.images">
        <img style="display:inline-block;padding: 0 10%" height="160px" width="80%" :src="i.img" class="part-img">
      </div>
      <div class="content-img">
        <input id="takepic" type="file" accept="image/*" @change="takepic">
        <div class="part-img imgplus">
          <svg style="width:40px;height:40px" aria-hidden="true">
            <use xlink:href="#icon-gouwu--copy"></use>
          </svg>
        </div>
      </div>
    </div>
    <div class="note-time" style="margin-bottom: 80px">{{daytime}}</div>
  </div>
</template>

<script type="text/ecmascript-6">
  import headerdone from './header/header-done'
  export default{
    data(){
      return {
        note: {
          'title': '',
          'content': '',
          'images': [],
          'date': '2-12'
        },
        notte: {},
        daytime: '',
        notes: [
          {
            'title': '当代世界经济',
            'content': '不可否认的是，美国经济在2017年开始放缓，但美国国内生产总值数据中出现了众所周知的季节性调整偏差。不可否认的是，美国经济在2017年开始放缓，但美国国内生产总值数据中出现了众所周知的季节性调整偏差。中国的经济增长率保持稳定，官方数据在未来几个季度应该会更好。此外，世界其他地区的经济也在加速增长。此外，世界其他地区的经济也在加速增长。国际货币基金组织在4月份上调了对全球经济增长的预测。世界经济预计今年将增长3.5%，高于去年的3.1%。',
            'images': [
              {
                'img': 'data:image/jpeg;base64,'
              },
              {
                'img': 'data:image/jpeg;base64,'
              }
            ],
            'date': '2-12'
          },
          {
            'title': '西方政治思想史纲',
            'content': '自然政治观是古代希腊、罗马时期的基本政治观。古希腊是西方政治思想的发源地，这一时期也是西方政治思想的奠基时期。古希腊的思想家们很早就开始探索宇宙的本源和规律，以后又发展到探索社会、国家的本源和规律,他们按照人类世界的结构又创造出一个神的世界，而且两者是独立存在、互不干扰的。在这一基础上，思想家们认为政治秩序是社会发展的必然要求，是自然而然形成的。',
            'images': [
              {
                'img': 'data:image/jpeg;base64,'
              },
              {
                'img': 'data:image/jpeg;base64,'
              },
              {
                'img': 'data:image/jpeg;base64,'
              }
            ],
            'date': '3-12'
          }
        ]
      }
    },
    components: {
      headerdone
    },
    created(){
      document.body.style.backgroundColor = 'white'
      this.$parent.rout = '/index'
      if (this.$route.query.index !== (this.notes.length + '')) {
        this.$nextTick(() => {
          this.note = this.notes[this.$route.query.index]
        })
      }
      let time = new Date()
      // 程序计时的月从0开始取值后+1
      let m = time.getMonth() + 1
      this.daytime = time.getFullYear() + '-' + m + '-' + time.getDate() + ' ' + time.getHours() + ':' + time.getMinutes()
    },
    mounted(){
      document.getElementById('note-title').focus()
    },
    methods: {
      backsummary(){
        history.go(-1)
      },
      takepic(){
        let url = null
        let picfile = document.getElementById('takepic').files[0]
        if (window.createObjectURL !== undefined) { //  basic
          url = window.createObjectURL(picfile)
        } else if (window.URL !== undefined) { //  mozilla(firefox)兼容火狐
          url = window.URL.createObjectURL(picfile)
        } else if (window.webkitURL !== undefined) { // webkit or chrome
          url = window.webkitURL.createObjectURL(picfile)
        }
        this.$nextTick(() => {
          this.note.images.push({'img': url})
        })
      }
    }
  }
</script>

